// App.js
import React from 'react';
import TodoList from './component/TodoList';
import NavigationMenu from './component/NavigationMenu';

const App = () => {
  return (
    <div>
      <h1>Aplicación de Gestión de Pendientes de la NFL</h1>
      <NavigationMenu />
      <TodoList />
    </div>
  );
};

export default App;
